import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

const LoginForm = () => {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [error, setError] = useState("");
  const navigate = useNavigate();

  const handleLogin = async (e) => {
    e.preventDefault();
    setError("");

    try {
      const response = await fetch("https://qa-uaesaas-api.instapract.ae/web/api/default/login", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          APPID: "Gem3s12345",
        },
        body: JSON.stringify({
          username,
          password,
          role_id: "143f37f2-ca38-0ab1-2489-1e47113655fc",
          device_id: "55c3389cb5ddd720dc0297617f3561c43a36218a277c974c8d43d545a643f45c",
          os_id: "b93a9204-ee21-4cf9-8a94-cf5eeabf7301",
          language: "da315627-3ece-2016-c628-b61dc5ee9be0",
        }),
      });

      const data = await response.json();

      console.log("Login API Response:", data);

      if (response.ok && data.token) {
        console.log("Trying to save token:", data.token);
        localStorage.setItem("token", data.token);
        console.log("Saved token?", localStorage.getItem("token"));
        navigate("/doctor");
      } else {
        setError(data.msg || "Login failed");
      }
    } catch (err) {
      console.error("Login error:", err);
      setError("Something went wrong. Please try again.");
    }
  };

  return (
    <div className="max-w-md mx-auto mt-10 p-6 bg-white shadow rounded">
      <h2 className="text-2xl font-semibold mb-4">Login</h2>
      <form onSubmit={handleLogin}>
        <input
          type="text"
          placeholder="Username"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
          className="w-full mb-3 p-2 border rounded"
        />
        <input
          type="password"
          placeholder="Password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          className="w-full mb-3 p-2 border rounded"
        />
        <button type="submit" className="w-full bg-blue-600 text-white py-2 rounded">
          Login
        </button>
        {error && <p className="text-red-500 mt-2">{error}</p>}
      </form>
    </div>
  );
};

export default LoginForm;
